import React from 'react'
import {Formik, Form, Field, ErrorMessage, validateYupSchema} from 'formik'
import './createCustomer.css';
import * as Yup from 'yup';

function createCustomer() {

  const initialValues = {
    name: "",
    age: "",
  };

  const validationSchema = Yup.object().shape({
    name:Yup.string().required(),
    age: Yup.number().required().positive().integer(),
  })

  const onSubmit = (data)=>{
    console.log(data);
  }
  return (
    <div className="block">
        <Formik initialValues={{ name: "", age: "" }} onSubmit={onSubmit} validationSchema={validationSchema} >
            <Form className='block_info'>
              <label>ชื่อ</label>
              <ErrorMessage name="name" component="span"/>
              <Field id="input" name="name" placeholder="ชื่อ-นามส"/>
              <label>อายุ</label>
              <ErrorMessage name="age" component="span"/>
              <Field id="input" name="age" placeholder="อายุ"/>
              <button type="submit">เพิ่มผู้ป่วย</button>
            </Form>
        </Formik>
    </div>
  )
}

export default createCustomer
